INSERT INTO `positions` (`id`, `title`, `summary`, `division`, `location`, `description`, `requirements`, `responsibilities`, `image`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Yazılım Geliştirici', 'Dinamik ve yenilikçi bir yazılım geliştirme pozisyonu.', 'Engineering', 'İstanbul', 'Yazılım projelerinde aktif rol alacak, kodlama yapacak ve sorunları çözebilecek bir yazılım geliştirici arıyoruz.', 'İyi derecede JavaScript ve React bilgisi, problem çözme yeteneği, takım çalışmasına uygunluk.', 'Yazılım geliştirmek, kod incelemek, teknik dokümantasyon hazırlamak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:35:27', '2024-08-31 22:43:38'),
(2, 'Pazarlama Uzmanı', 'Yaratıcı ve stratejik düşünme yeteneğine sahip bir pazarlama uzmanı arıyoruz.', 'Marketing', 'Ankara', 'Şirketimizin pazarlama stratejilerini geliştirecek ve uygulayacak bir uzman arıyoruz.', 'Pazarlama stratejileri oluşturma deneyimi, iyi iletişim becerileri, analitik düşünme.', 'Pazar araştırması yapmak, kampanya planlamak, performans analizleri yapmak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:35:27', '2024-08-31 22:43:36'),
(3, 'Ürün Yöneticisi', 'Ürün geliştirme süreçlerini yönetecek bir ürün yöneticisi arıyoruz.', 'Others', 'İstanbul', 'Ürün yol haritasını oluşturacak ve geliştirme sürecini yönetecek deneyimli bir ürün yöneticisi arıyoruz.', 'Ürün yönetimi deneyimi, liderlik becerileri, analitik düşünme.', 'Ürün stratejileri oluşturmak, ekipleri koordine etmek, ürün performansını analiz etmek.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:30'),
(4, 'İnsan Kaynakları Uzmanı', 'İşe alım ve çalışan ilişkileri süreçlerini yönetecek bir insan kaynakları uzmanı.', 'HR', 'İstanbul', 'Şirketin insan kaynakları süreçlerini yönetecek, işe alım ve çalışan ilişkilerini geliştirecek bir uzman arıyoruz.', 'İK yönetimi deneyimi, güçlü iletişim becerileri, organizasyon yeteneği.', 'İşe alım süreçlerini yürütmek, çalışan memnuniyetini artırmak, İK raporları hazırlamak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:28'),
(5, 'Grafik Tasarımcı', 'Yaratıcı grafik tasarımlar oluşturacak bir tasarımcı arıyoruz.', 'Others', 'İstanbul', 'Şirketin görsel ihtiyaçlarını karşılayacak ve yaratıcı grafik tasarımlar üretecek bir grafik tasarımcı arıyoruz.', 'Adobe Creative Suite bilgisi, yaratıcı düşünme, portföy.', 'Grafik tasarım yapmak, marka kimliğini oluşturmak, projeleri zamanında teslim etmek.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:25'),
(6, 'Finans Analisti', 'Şirketin finansal performansını analiz edecek bir finans analisti.', 'Others', 'Ankara', 'Şirketin mali verilerini analiz edecek, raporlar hazırlayacak ve finansal stratejileri destekleyecek bir analist arıyoruz.', 'Finansal analiz deneyimi, analitik düşünme, MS Excel bilgisi.', 'Finansal raporlar hazırlamak, bütçe analizleri yapmak, mali trendleri izlemek.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:23'),
(7, 'Müşteri Hizmetleri Temsilcisi', 'Müşteri taleplerini yönetecek ve sorunları çözecek bir temsilci arıyoruz.', 'Others', 'İstanbul', 'Müşteri memnuniyetini artıracak, müşteri taleplerini ve sorunlarını çözebilecek bir müşteri hizmetleri temsilcisi arıyoruz.', 'İyi iletişim becerileri, müşteri odaklı yaklaşım, problem çözme yeteneği.', 'Müşteri taleplerini yanıtlamak, şikayetleri çözmek, müşteri geri bildirimlerini toplamak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:20'),
(8, 'Web Geliştirici', 'Web uygulamaları geliştirecek bir web geliştirici arıyoruz.', 'Engineering', 'İstanbul', 'Web uygulamaları ve siteleri geliştirecek, performanslarını optimize edecek bir web geliştirici arıyoruz.', 'HTML, CSS, JavaScript bilgisi, web geliştirme deneyimi.', 'Web uygulamaları geliştirmek, kodları test etmek, teknik destek sağlamak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:18'),
(9, 'SEO Uzmanı', 'Web sitelerinin arama motoru optimizasyonunu yapacak bir SEO uzmanı.', 'Marketing', 'İstanbul', 'Web sitelerinin arama motorlarında daha yüksek sıralamalara ulaşmasını sağlamak için SEO stratejileri geliştirecek bir uzman arıyoruz.', 'SEO araçları bilgisi, analitik düşünme, SEO stratejileri oluşturma deneyimi.', 'SEO analizleri yapmak, anahtar kelime araştırması yapmak, site içi ve site dışı optimizasyon sağlamak.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:16'),
(10, 'Yazılım Test Mühendisi', 'Yazılım uygulamalarını test edecek ve kaliteyi güvence altına alacak bir test mühendisi.', 'Engineering', 'İstanbul', 'Yazılım uygulamalarının işlevselliğini test edecek, kalite standartlarını sağlayacak bir test mühendisi arıyoruz.', 'Test otomasyon araçları bilgisi, yazılım test deneyimi, dikkatli çalışma.', 'Yazılım test senaryoları hazırlamak, hataları raporlamak, test sonuçlarını analiz etmek.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:14'),
(11, 'Proje Yöneticisi', 'Projeleri yönetmek ve teslim tarihlerini takip etmek için deneyimli bir proje yöneticisi.', 'Engineering', 'İstanbul', 'Projelerin zamanında ve bütçeye uygun şekilde tamamlanmasını sağlamak için deneyimli bir proje yöneticisi arıyoruz.', 'Proje yönetimi deneyimi, liderlik becerileri, bütçe yönetimi bilgisi.', 'Projeleri planlamak, ekipleri yönetmek, proje ilerlemesini izlemek.', 'https://i.imghippo.com/files/W5RRQ1724874441.jpg', 1, '2024-08-26 22:36:48', '2024-08-31 22:43:12'),
